import { useState } from "react"

export const App = () => {

    const [userQuery, setUserQuery] = useState('');

    const updateUserQuery = (e) => setUserQuery(e.target.value);

    const serachQuery = () => {
        window.open(`https://www.google.com/search?q=${userQuery}`)
    }

    return (
        <div>
            <h1>Hello Deepen!</h1>
            <div className="form">
                <input value={userQuery} onChange={updateUserQuery}></input>
                <button>Search</button>
            </div>
        </div>
    )
}
